#include <iostream>

using namespace std;

class Solution {
public:
    bool isAnagram(string s, string t) {
        int m[26]={0};
        int s_len = s.length();
        int t_len = t.length();

        if(s_len != t_len) return false;

        for(int i=0;i<s_len;i++) {
            m[s[i]-'a']++;
        }

        for(int i=0;i<26;i++) {
            cout << i << " - " << m[i] << endl;
        }

        for(int i=0;i<t_len;i++) {
            m[t[i]-'a']--;

            if(m[t[i]-'a'] < 0) 
                return false;
        }

        for(int i=0;i<26;i++) {
            cout << i << " - " << m[i] << endl;
        }
        
        return true;
    }
};

int main() {
    Solution s;
    string a = "";
    string b = "";

    cout << s.isAnagram(a,b) << endl;
    return 0;
}